import react from 'react';
import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';

import img1 from './story3.jpg';
import img2 from './story4.jpg';

const Slide = () => {
  return (
    <AwesomeSlider>
      <div data-src={img1} />
      <div data-src={img2} />
    </AwesomeSlider>
  );
};

export default Slide;
